import initState from './reduce-abc';

export default function (state=initState, action){
  switch(action.type){
    case 'USER_SELECTED':
      return action.payload;
      break;
    case 'USER_REMOVED':
      return state.filter(city => city.name !== action.payload.name);
      break;
  }
  return state;
}
